import React,{useReducer} from 'react';
import { itemContext } from './store/context';
import { initialState, myReducer } from './store/reducer';
import './App.css';
import { Switch, Route } from 'react-router-dom';
import DashBoadLayout from './pages/DashBoadLayout';

const App=()=> {
  const [myState, dispatch] = useReducer(myReducer, initialState);

  return (
    <div className="App">

    <Switch>
    <Route exact path='/' render={ props=>< DashBoadLayout {...props}/>}/>
    </Switch>
    </div>
  );
}

export default App;
